import React, { Component } from "react";
import Header from "./Header";
import pic from "../assets/cleanstreet.jpg";
import logo3 from "../assets/truck.png";

class Home extends Component {
  render() {
    return (
      <div>
        <div>
          <img src="logo3" />
          <Header title="TRASH IT" />
        </div>

        <h1>This is the best time to dispose that Trash</h1>
        <img src="pic" />
      </div>
    );
  }
}
export default Home;
